a!localVariables(
  local!evaluation: a!refreshVariable(
    value: rule!AS_GSS_QR_getEvaluation(
      evaluationId: rv!identifier,
      fields: {
        recordType!AS_GSS_Evaluation_SYNCEDRECORD.evaluationDueDate
      },
      returnType: cons!AS_CO_ENUM_QE_RETURN_TYPE_SINGLE_OBJECT
    ),
    refreshAfter: "RECORD_ACTION"
  ),
  local!evaluationPhases: a!refreshVariable(
    value: rule!AS_GSS_QR_getEvaluationPhases(
      returnType: cons!AS_CO_ENUM_QE_RETURN_TYPE_OBJECT_ARRAY,
      fields: {
        recordType!AS_GSS_EvaluationPhase_SYNCEDRECORD.taskCategory
      },
      evaluationId: rv!identifier
    ),
    refreshAfter: "RECORD_ACTION"
  ),
  {
    evaluation: local!evaluation,
    originalEvaluation: local!evaluation,
    /* AS_GSS_Evaluation_SYNCEDRECORD */
    evaluationPhases: local!evaluationPhases,
    /* List of AS_GSS_EvaluationPhase_SYNCEDRECORD */
    originalEvaluationPhases: local!evaluationPhases,
    /* List of AS_GSS_EvaluationPhase_SYNCEDRECORD */
    userAction: null/* Text */

  }
)

